import { ManagerCard } from "components/ManagerCard";
import constants from "../../utils/constants";
import s from "./index.module.scss";

export const OurContactsPubg = () => {
  return (
    <div className={s["our-contacts-pubg"]}>
      <h3 className={s["out-contacts-pubg__title"]}>Наши Контакты!</h3>
      <div className={s["cards-wrapper"]}>
        {constants.managers.map((item, index) => (
          <ManagerCard {...item} key={`manager-card-key-index-${index}`} />
        ))}
      </div>
    </div>
  );
};
